import React from 'react';


const ChangeColorButtons = (props) => {
    return(
        <div className='buttons-panel'>
            <button onClick={ () => {
                props.buttonMethod('add');
            }}>Add 1</button>
            <button onClick={ () => {
                props.buttonMethod('reinit');
            }}>ReInit</button>
            <button onClick={ () => {
                props.buttonMethod('reset');
            }}>Reset</button>
        </div>
    );
}

export default ChangeColorButtons;
